import React from 'react';
import {Button, Input} from 'semantic-ui-react';


function Login(){
  return(
    <div>
      <Input/>
      <Button onClick={(e)=>{
        console.
        alert(e.target.value)}}>로그인</Button>
    </div>
  )
}

function App() {
  return (
    <div className="App">
      <Button basic color='green' content='버튼' />
      <Login/>
    </div>
  );
}

export default App;
